let url = 'https://object-detection-369309.ew.r.appspot.com/image?';
// let url = 'https://object-detection-369309.ew.r.appspot.com/image?';
// let url = 'http:localhost:8080/image?';
var details = {
    'base64image': `data:image/jpeg;base64,${base64String}`
};
var formBody = [];
for (var property in details) {
    var encodedKey = encodeURIComponent(property);
    var encodedValue = encodeURIComponent(details[property]);
    formBody.push(encodedKey + "=" + encodedValue);
}
formBody = formBody.join("&");
let data = fetch(url, {
    method: 'POST',
    headers: {
        'Accept': '*/*',
        'Content-Type': 'application/x-www-form-urlencoded;charset=UTF-8'
    },
    body: formBody
        // body: JSON.stringify({ "base64image": base64String })
});

data.then(res => res.text()) // convert to plain text
    .then(text => console.log(text));



